/*
Programcilar Talimatlar覺

u k覺sa videoyu izleyin:
https://www.ergineer.com/assets/materials/a664dfe7-programcilar.gif

Bu bileen, bir yandan programlama alan覺ndaki 繹nc羹lerin bir listesini,
ve dier tarafta o anda 繹ne 癟覺kan programc覺n覺n idsini izler. Yani 2 adet state dilimi!
Ayn覺 zaman i癟inde yaln覺z bir harika programc覺y覺 繹ne 癟覺karabiliriz.

Yorumlar覺 takip edin.
*/

import React, { useState } from "react";
/* ADIM 0  */

// Bu deikeni YALNIZCA bir state dilimini balatmak i癟in kullan覺n!
// JSX'te u anda bu kural覺 癟ineyen bir ey var...
// Export syntax覺, test kitapl覺覺n覺n diziyi i癟e aktarabilmesi i癟in gereklidir.
export const enIyilerListesi = [
  { id: "1", isim: "Ada Lovelace" },
  { id: "2", isim: "Grace Hopper" },
  { id: "3", isim: "Evelyn Boyd Granville" },
  { id: "4", isim: "Mary Kenneth Keller" },
  { id: "5", isim: "Frances Allen" },
  { id: "6", isim: "Carol Shaw" },
];

export default function Programcilar() {
  // 襤ki state dilimine ihtiyac覺m覺z olduundan, state hooku iki kez kullanmam覺z gerekecek..
  // Bir yanda programc覺lar listesi, dier yanda 繹ne 癟覺kan programc覺n覺n idsi.
  const [secilenProgramci, setSecilenProgramci] = useState(null);

  const oneCikaninIsmi = () => {
    // Bunu sona b覺rak覺n!
    // Bu bir event handler deil, yard覺mc覺d覺r. Kullan覺m覺n覺 JSX'te g繹zlemleyin.
    // ne 癟覺kan gelitiricinin _isim_ ad覺n覺 d繹nd羹rmek i癟in her iki state dilimini kullanacak.
    // Closurelar覺n g羹zellii, arg羹manlar yoluyla bilgi enjekte etmeye gerek kalmadan program覺n
    // bu b繹lgesinden her iki state dilimini de "g繹rebilmemiz"dir.
    for (let person of enIyilerListesi) {
      if (secilenProgramci === person.id) {
        return person.isim;
      }
    }
  };

  const stil = {
    fontSize: "1.5em",
    marginTop: "0.5em",
    color: secilenProgramci ? "gold" : "royalblue", //  kutlarken renk gold'a d繹necek
  };

  return (
    <div className="widget-programmers container">
      <h2>Programc覺lar</h2>
      <div className="programmers">
        {
          /* K繹t羹 bug! 'enIyilerListesi' yerine bir state dilimini maplemeliyiz.
          // 繹yle diyebiliriz: "aa bu 癟al覺覺yor!" Ama programcilar bir state diliminden gelmiyorsa,
          // asla yeni programci ekleyemeyiz, programcilari d羹zenleyemeyiz ya da silemeyiz. D羹zeltin!
          " */
          enIyilerListesi.map((dev) => (
            <div className="programmer" key={dev.id}>
              {dev.isim}{" "}
              <button
                onClick={() => {
                  /* burada dev.id 'yi 繹ne 癟覺kan id'ye atay覺n */
                  setSecilenProgramci(dev.id);
                }}
              >
                Kutla
              </button>
            </div>
          ))
        }
      </div>
      <div id="featured" style={stil}>
        {
          // 癟l羹ler, bir eyin "ger癟ekliine" bal覺 olarak "bir eyi veya dierini" ifade etmek i癟in harikad覺r..
          // S繹zde-kod: 繹ne 癟覺kan true ise metin 1'i oluturun, aksi takdirde metin 2'yi oluturun..
          // Sabit kodlanm覺 false'u doru deikenle deitirin.
          secilenProgramci
            ? ` Hadi ${oneCikaninIsmi()}'覺 kutlayal覺m! 戊`
            : "Harika bir programc覺 se癟in"
        }
      </div>
    </div>
  );
}
